import React from 'react';
import Avatar from '@material-ui/core/Avatar';
import Button from '@material-ui/core/Button';
import CssBaseline from '@material-ui/core/CssBaseline';
import TextField from '@material-ui/core/TextField';
import FormControlLabel from '@material-ui/core/FormControlLabel';
import Checkbox from '@material-ui/core/Checkbox';
import links from '@material-ui/core/Link';
import Paper from '@material-ui/core/Paper';
import Box from '@material-ui/core/Box';
import Grid from '@material-ui/core/Grid';
import AccountBoxIcon from '@material-ui/icons/AccountBox';
import Typography from '@material-ui/core/Typography';
import { makeStyles } from '@material-ui/core/styles';

import {Link } from "react-router-dom"
import Sing_up_page from '../sing_up/sing_up_page';
import { render } from '@testing-library/react';

//import { Button} from 'antd';





function Copyright() {
  return (
    <Typography variant="body2" color="red" align="center">
      {'Copyright © '}
      <links color="inherit" href="https://www.instagram.com/mao_._oo/">
        Sam Mao
      </links>{' '}
      {new Date().getFullYear()}
      {'.'}
    </Typography>
  );
}

const useStyles = makeStyles((theme) => ({
  root: {
    height: '100vh',
  },
  image: {
    backgroundImage: 'url(https://www.biography.com/.image/t_share/MTM5OTQxMzEwNjcxODg5NDQ5/stephen-curry-gettyimages-538912798_verticaljpg.jpg)',
    backgroundRepeat: 'no-repeat',
    backgroundColor:
      theme.palette.type === 'light' ? theme.palette.grey[50] : theme.palette.grey[900],
    backgroundSize: 'cover',
    backgroundPosition: 'center',
    height : '1000px',

  },
  paper: {
    margin: theme.spacing(8, 4),
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
  },
  avatar: {
    margin: theme.spacing(1),
    backgroundColor: theme.palette.secondary.main,
  },
  form: {
    width: '100%', // Fix IE 11 issue.
    marginTop: theme.spacing(1),
  },
  submit: {
    margin: theme.spacing(3, 0, 2),
  },
}));



export default function Login_page() {

  const classes = useStyles();

    return (
      <Grid container component="main" className={classes.root}>

        <CssBaseline />
        <Grid item xs={false} sm={4} md={7} className={classes.image} />
        <Grid item xs={12} sm={8} md={5} component={Paper} elevation={6} square>
          <div className={classes.paper}>
            <Avatar className={classes.avatar}>
              <AccountBoxIcon />
            </Avatar>
            <Typography component="h1" variant="h5">
              Welecome to this web ,
              Sign in
            </Typography>
            <form className={classes.form} noValidate>
              <TextField

                margin="normal"
                required
                fullWidth
                id="email"
                id="number"
                label="Email Address or phone number"
                name="email"
                autoComplete="email"
                autoFocus
              />
              <TextField
                margin="normal"
                required
                fullWidth
                name="password"
                label="Password"
                type="password"
                id="password"
                autoComplete="current-password"
              />
              <Button
                type="submit"
                halfWidth
                variant="contained"
                color="primary"
                className={classes.submit}
                >
                Sign In
              </Button>
                <Button
                type="submit"
                fullWidth
                variant="contained"
                color="primary"
                className={classes.submit}
                >
                <Link exact to = "/signup" >Sign Up </Link>
                </Button>

              <Box mt={3}>
                <Copyright />
              </Box>
            </form>
          </div>
        </Grid>
      </Grid>
    );

}
